import React from 'react'
import { NavLink } from 'react-router-dom'

function TrainStations({ stations }) {
    return <div className="train-stations">
        {Object.keys(stations).map((stationName) => {
            <NavLink className={({isActive}) => `train-station__link ${isActive ? 'train-stations__link--active' : ''}`} />
        })}
    </div>
}

export default TrainStations
